import React, { Component } from 'react'

class Search extends Component {
    constructor(props){
        super (props)
        this.state = {
            search : '',
        }
    }
    render() {
        return (
            <div className="Search">
                <div class='SearchItems'>
                    <input type="search" name="" id="input" class="form-control" defaultValue="Search" value={this.state.search} onChange={this.onChange}/>
                    <button class="btn"><i class="fa fa-trash"></i> Clear</button>
                </div>
            </div>)
    }
}
export default Search
